import React from 'react'
import ReactStrapAlerts from './practice/ReactstrapAlert';
import './App.css'
import 'bootstrap/dist/css/bootstrap.css'

const App = () =>{
    return(
        <div>
            <h1>Start React 200!</h1>
            <p>CSS 적용하기</p>
            <ReactStrapAlerts />
        </div>
    );
}   

export default App;
